import React, { Component } from 'react'; 
import './index.css';

export default class Navbar extends Component {
  render() {
    return(
      <div>
          <nav>
              <ul>
                <div className="container">
                  <div className="row">

                    <div className="col d-flex">
                      <li><a href="index.html"><img className="nav-dim" src="./img/logo.png" alt="Animal Forest logo"/></a></li>
                    </div>

                    <div className="col-6 d-flex"></div>
                        <div className="col d-flex pt-2">
                            <li><a href="index.html" aria-label="Home page">Change Goal</a></li>
                            {/* <li><a href="About.html" aria-label="About page">About</a></li> */}
                        </div> 
                  </div>
                </div>
              </ul>
          </nav>
      </div>
    );
  }
}
